    //     var m = "0" + dt.getMinutes();
    //     var s = "0" + dt.getSeconds();
    //     return hr + ':' + m.substr(-2) + ':' + s.substr(-2);
    // }
    var dateString = moment.unix(sunrise).format("hh:MM:ss");
    console.log(dateString);

    return (
        <div>
            {SearchBar}
            {location} <br />
            {country} <br />
            {temp} <br />
            {maxTemp} <br />
            {minTemp} <br />
            {main} <br />
            {description} <br />
            {icon} <br />
            {humidity}%<br />
            {windSpeed} m/s <br />
            {clouds}% <br />
            {sunrise} <br />
            {sunset} <br />
        </div>
    )
}
